class Wall
	attr_accessor :lx, :lz, :rx, :rz, :tid,
		:slx, :slz, :slty, :slby,
		:srx, :srz, :srty, :srby
	
	def initialize(lx, lz, rx, rz, tid)
		trace("Initializing Wall")
		@lx = lx
		@lz = lz
		@rx = rx
		@rz = rz
		@tid = tid
		s = "Wall Initialized"
		s += "\nlx: " + lx.to_s
		s += "\nlz: " + lz.to_s
		s += "\nrx: " + rx.to_s
		s += "\nrz: " + rz.to_s
		s += "\ntid: " + tid.to_s
		trace(s)
	end	
	def screen_space_left(slx, slz, slty, slby)
		@slx = slx
		@slz = slz
		@slty = slty
		@slby = slby
	end
	def screen_space_right(srx, srz, srty, srby)
		@srx = srx
		@srz = srz
		@srty = srty
		@srby = srby
	end
end

