### Tool Functions
###


def lerp1(a, b, l)
  return a + (b - a) * l.clamp(0, 1)
end


def lerp2(a, b, l)
  return [
    a[0] + (b[0] - a[0]) * l.clamp(0, 1),
    a[1] + (b[1] - a[1]) * l.clamp(0, 1)
  ]
end




def quad_bez(a, b, c, l)
	q0 = lerp2(a, b, l)
	q1 = lerp2(b, c, l)
	return lerp2(q0, q1, l)
end


def dir_to(a, b)
  return normalize(sub_vecs(b, a))
end


def add_vecs(a, b)
  return[
    a[0] + b[0],
    a[1] + b[1]
  ]
end


def sub_vecs(a, b)
  return add_vecs(a, scale_vec(b, -1.0))
end


def vec_mag(vec)
  return Math.sqrt(
    (vec[0] * vec[0])\
    +
    (vec[1] * vec[1])
  )
end


def normalize(vec)
  mag = vec_mag(vec)
  if mag > 0 then
    return [vec[0] / mag, vec[1] / mag]
  end
end


def multiply_vecs(a, b)
  return[
    a[0] * b[0],
    a[1] * b[1]
  ]
end


def scale_vec(vec, sca)
  return[
    vec[0] * sca,
    vec[1] * sca
  ]
end


def vec_rotated(vec, rot)
  sin = Math.sin(rot)
  cos = Math.cos(rot)
  return[
    vec[0] * cos - vec[1] * sin,
    vec[0] * sin + vec[1] * cos
  ]
end


def aabb(p1, d1, p2, d2)
  return (
    p1[0] < p2[0] + d2[0] and \
    p2[0] < p1[0] + d1[0] and \
    p1[1] < p2[1] + d2[1] and \
    p2[1] < p1[1] + d1[1]
  )	
end


def dist(a, b)
  v = sub_vecs(a, b)
  return Math.sqrt(
    (v[0] * v[0])\
    + 
    (v[1] * v[1])
  )
end

